import { useState, useEffect } from "react";
import "./styles.css";

type resultProps = {
    name: string, 
    height: number, 
    mass: string, 
    hair_color:string, 
    skin_color: string, 
    eye_color: string, 
    birth_year: string, 
    gender: string, 
    homeworld: string, 
};

 const StarApi=()=> {
  const [result, setResult] = useState<resultProps[]>([]);

  useEffect(() => {
    const api = async () => {
      const data = await fetch("https://swapi.dev/api/people/", {
        method: "GET"
      });
      const jsonData = await data.json();
      setResult(jsonData.results);
    };

    api();
  }, []);

  return (
    <div className="App">
      <h1>
        {result.map((value) => {
          return (
            <div>
              <div>{value.name}</div>
              <div>{value.gender}</div>
            </div>
          );
        })}
      </h1>
      <h2>Start editing to see some magic happen!</h2>
    </div>
  );
}

export default StarApi;
